# ╔═╡ 2d41eda5-4ddd-4bee-b618-62f79ae82ab0
md"""
### SEITD - Sistema de Equações Diferenciais Ordinárias
"""

# ╔═╡ df548617-3f56-403f-9f78-95d681f0acb4
md"""
> Em inglês *Ordinary Differential Equations* -- ODEs
"""

# ╔═╡ 42cf26bc-058a-4ceb-b547-1a07682a184e
md"""
```math
\begin{align}
    \frac{dS}{dt} &= -\beta \frac{I}{N} S \\
    \frac{dE}{dt} &= \beta \frac{I}{N} S \\
    \frac{dI}{dt} &= \frac{1}{d_L} E - \frac{1}{d_I} I\\
    \frac{dR}{dt} &= \frac{1}{d_I} I \left(1 - \omega\right) \\
    \frac{dT}{dt} &= \frac{1}{d_I} I \omega - \frac{1}{d_T} T \\
    \frac{dD}{dt} &= \frac{1}{d_T} T
\end{align}
```
"""

# ╔═╡ a9aca811-6a4e-47fb-8110-93aacea384e3
md"""
onde:

* β - taxa de infecção
* ω - taxa de letalidade
* dL - tempo médio entre infecção e a incidência da doença
* dI - tempo médio que o indivíduo permanece infectado
* dT - tempo médio que o indivíduo fica doente em estado terminal
"""

# ╔═╡ af2276d8-9028-45d8-91d9-814145d5d9ef
md"""
# Aplicação em Julia
"""

# ╔═╡ 0c0d6703-c0d6-4441-878b-9747921f08a2
